window.bookSummaryJSON = "<p><b>I am a spy for my alphas, and I will bring the king down from within...</b></p> <p>After winning the Rite, a brutal three-part test for the alpha female of the Fall Mountain Pack, I was betrayed by everyone around me. I didn't see it coming, and neither did my alphas.</p> <p>Ragnar Fall was a trick played perfectly by the angel king, and he almost destroyed the Fall Mountain Pack... until he was fooled by me. Now I'm in his world, at his side, and I'm going to get the alliances my pack needs to build an army against him.</p> <p>I was once a rejected wolf, but now I'm fighting to be their queen.</p> <p>My four mates. My dark alphas. My Hades.</p> <p>King Cenwyn will never see me coming. I am the alpha female of Fall Mountain Pack, and I am going to start a war that will change our world.</p> <p><i>This is a full-length reverse harem romance novel full of sexy alpha males, steamy scenes, a strong heroine, and a lot of sarcasm. This is book four in this series.</i></p>"; 
